data.value:
Формат файла – Microsoft Excel.
Будет обработан только первый лист с файла.
Столбцы с данными в файле должны быть в следующем порядке:
1 – дата;
2 – время;
3 – Температура, t°C;
4 – Атмосферное давление, кПа;
5 – Влажность, %;
6 – Скорость ветра, м/с;
7 – Направление ветра;
8 – Общие погодные условия;
9 – Значение.

Формат файла – Microsoft Excel.
Будет обработан только первый лист с файла.
Столбцы с данными в файле должны быть в следующем порядке:
1 – год;
2 – месяц;
3 – среднемесячная концентрация загрязняющего вещества, мг/м³;
4 – максимально-разовая концентрация загрязняющего вещества, мг/м³ за месяц;
5 – день регистрации максимально-разовой концентрации по загрязняющему веществу.

Формат файла – Microsoft Excel.
Будет обработан только первый лист с файла.
Столбцы с данными в файле должны быть в следующем порядке:
1 – дата;
2 – время;
3 – Длительность запрещающего сигнала, с.;
4 – Общее количество автотранспорта за 20 минут;
5 – Протяженность прогона, м;
6 – Средняя скорость движения, км/ч.

Формат файла – Microsoft Excel.
Будет обработан только первый лист с файла.
Столбцы с данными в файле должны быть в следующем порядке:
1 – Дата отбора пробы;
2 – Дата анализа пробы;
3 – Значение.
